import re

def parse_data(inputs):
    parsed_data = []
    pattern = '([^()]+) \\(([^()]+)\\)'
    for i in inputs:
        match = re.findall(pattern, i)
        for m in match:
            parsed_data.append({'': m[0].strip(), 'occupation': m[1].strip()})
    return parsed_data

